def generate_candidate_keys():
    permutaions=list(itertools.permutations(['a','b','c','d','e','f','g','h'], 8))
    candidate_lst=[]
    for i in permutaions:
        temp={}
        zipped=zip(['a','b','c','d','e','f','g','h'],list(i))
        for key,value in zipped:
            temp[key]=value
        candidate_lst.append(temp)
    return candidate_lst

def generate_orthogonal_keys():
    candidate_dict={}
    for char in ['a','b','c','d','e','f','g','h']:
        for key_char in ['a','b','c','d','e','f','g','h']:
            key=(key_char,char)
            candidate_key= {}
            candidate_key[key_char]=char
            candidate_dict[key]=candidate_key
    return candidate_dict



def generate_top_keys(pairs):
    k_dict={}
    valid_lst=[]
    for key in ['a','b','c','d','e','f','g','h']:
        temp_score=0
        for p in pairs:
            if p[0][0]==key:
                if not k_dict.has_key(key):
                   temp_score=p[1]
                   k_dict[key]=[]
                   k_dict[key].append(p[0])
                elif p[1]==temp_score:
                    k_dict[key].append(p[0])
                else:
                    break
    candidate_lst=list(itertools.product(*k_dict.values()))
    for candidate in candidate_lst:
        if is_valid_key(candidate):
            valid_lst.append(dict(candidate))
    return valid_lst

def is_valid_key(candidate):
    keys=[]
    vals=[]
    a=['a','b','c','d','e','f','g','h']
    for key,val in candidate:
        keys.append(key)
        vals.append(val)
    if sorted(keys)==a and sorted(vals)==a:
        return True
    else:
        return False




def main():
    start_time = time.time()
    dict={}
    ciphertxt_path, iv_path = sys.argv[1:]
    divided_ciphertxt = divide_to_blocks(ciphertxt_path)
    iv = file_to_string(iv_path)
    candidate_keys=generate_candidate_keys()
    for key in candidate_keys:
        dict[tuple(sorted(key.items()))]=calc_score(decrypt(key,divided_ciphertxt,iv))
    chosen_key=max(dict.iteritems(), key=operator.itemgetter(1))[0]
    print("--- %s seconds ---" % (time.time() - start_time))
    return chosen_key

